import React from 'react';
import {
    Row,
    Col
} from 'reactstrap';
import { SalesSummary, Projects, Feeds, SocialCards } from 'components/dashboard-components';

const Starter = () => {
    return (
        <div>
            <Row>
                <Col sm={4} lg={8}>
                    <SalesSummary />
                </Col>
                <Col sm={6} lg={4}>
                    <Feeds />
                </Col>
            </Row>
            <Row>
                <Col sm={5}>
                    <Projects />
                </Col>
            </Row>
            <SocialCards />
        </div>
    );
}

export default Starter;
